import React, { ReactNode, useState } from 'react';
import { Nav, Collapse, Button } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

interface CollapsibleNavLinkProps {
  to: string;
  children: ReactNode;
}

const CollapsibleNavLink: React.FC<CollapsibleNavLinkProps> = ({ to, children }) => {
  const [open, setOpen] = useState(false);

  return (
    <>
      <Button onClick={() => setOpen(!open)} aria-controls={to} aria-expanded={open}>
        {children}
      </Button>
      <Collapse in={open}>
        <div id={to}>
          <Nav.Link to={to} as={NavLink}>
            {children}
          </Nav.Link>
        </div>
      </Collapse>
    </>
  );
};

export default CollapsibleNavLink;
